import React from 'react';
import styled from 'styled-components';
import { Button, Backdrop, AppBar } from '@material-ui/core';
import ButtonAppBar from '../components/buttonAppBar';
import { withStyles } from '@material-ui/core/styles';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';


// Our single Styled Component definition
const AppContainer = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  position: fixed;
  width: 100%;
  height: 100%;
  font-size: 40px;
  background: rgb(111, 225, 225);
`;

const StyledButton = withStyles({
  root: {
    background: 'linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)',
    borderRadius: 3,
    border: 0,
    color: 'white',
    height: 48,
    padding: '0 30px',
    boxShadow: '0 3px 5px 2px rgba(255, 105, 135, .3)',
  },
  label: {
    textTransform: 'capitalize',
  },
})(Button);

const menu = <IconButton color="inherit" aria-label="Menu">
<MenuIcon />
</IconButton>

const App = () => <div><AppContainer><StyledButton>Hello World</StyledButton></AppContainer></div>;

export default App;
